14. 구성파일 작성
14.1 구성 파일 및 디렉토리
테라폼은 현재 디렉토리에 있는 모든 .tf or tf.json 파일 다 읽어 들임.
UTF8 인코딩을 사용하며 Windows 의 CRLF 도 허용한다.
다만, 가능하면 LF 타입을 쓰자.
14.2 구성 파일 기본
구성 파일에는 프로바이더, 프로바이더 요구사항, 리소스 등을 정의함.
다만 프로바이더는 꼭 안들어 가도 됨.
프로바이더는 블록으로 정의함.
블록 하나가 프로바이더 하나를 정의함.
들여쓰기에 민감하지 않음.
3) 프로바이더

프로바이더 예시terraform {
required_providers {
  aws = {
    source = "hashicopr/aws"
    version = "~> 3.34"
  }
}
}

~/.aws/config 폴더에 있음cat .aws/config
[default]
region = ap-northeast-2


