 =  #ARGUMENT
}



14.3
14.3 구성 파일 작성

aws ami(amazon machine image) 우분투 인스턴스 이미지 찾기
https://cloud-images.ubuntu.com/locator/ec2/

terraform {
  required_providers {
    aws = {
      source = "hashicorp/aws"
      version = "~> 3.34"
    }
  }
}

provider "aws" {
  profile = "default"
  region = "ap-northeast-2"
}

resource "aws_instance" "my_instance" {
  ami = "ami-05784cd9865e31efd" # Ubuntu 18.04 amd64 ami
  instance_type = "t3.micro"

  tags = {
    Name = "MyInstance"
  }
}

pages/Part16/note.html.body:
16.1
1) 입력 변수

목록은 항상 , 콤마가 있어야 함
변수 타입을 지정하지 않으면 기본으로 string 임.

테라폼은 변수 정의와 할당 하는 것이 별개이다!!!

*.tfvars 에 변수를 정의함
tfvars 파일도 git에다가 잘 올리지 않음. 사용자들이 작성하게 함! 올려도 상관 없긴 한데... 잘 안올림

provider.tf
```tf
terraform {
required_providers {
  aws = {
source  = "hashicorp/aws"
version = "~> 3.34"
  }
}
}


provider "aws" {
  profile = "default"
  region  = "ap-northeast-2"
}

* main.tf
```shell
resource "aws_instance" "my_instance" {
  ami           = var.ami_image[var.aws_region]
  instance_type = var.instance_type

  tags = {
    Name = "MyInstance"
  }
}


resource "aws_eip" "my_eip" {
  vpc      = true
  instance = aws_instance.my_instance.id
}

variable.tf
```tf
variable "aws_region" {
description = "AWS region"
type        = string
default     = "ap-northeast-1"
}

variable "ami_image" {
  description = "Ubuntu 20.04 LTS Image"
  type        = map(string)
  default = {
    "ap-northeast-1" = "ami-09ff2b6ef00accc2e"
    "ap-northeast-2" = "ami-0b329fb1f17558744"
  }
}
variable "instance_type" {
  description = "EC2 instance type"
  type        = string
  default     = "t3.micro"
}

